import React from 'react';
import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';

import styles from './Aboutaone.module.css';


const CustomAone = () => {
    return (
    <div>
       
            <Top />
            <div className={styles.down}>Customs Clearance & Drawback</div>
            <div class = "container">
           <h2> 복리후생</h2>

  
            </div>
            <Bottom />
        </div>
    );
};

export default CustomAone;
